import { useState } from 'react';

export default function Item({shoppingItems, completeShoppingItem }) {
	const [edit, setEdit] = useState({
		id: null,
		value: '',
	});

	return shoppingItems.map((shoppingItem, index) => (

		<div key={index} >
      <div key={shoppingItem.id} onClick={() => completeShoppingItem(shoppingItem.id)}>
        {shoppingItem.text}
      </div>
    </div>
	));
}
